-- View: public.business_days

-- DROP VIEW public.business_days;

CREATE OR REPLACE VIEW public.business_days
 AS
 SELECT w_time_d.time_id,
    row_number() OVER (ORDER BY w_time_d.time_id) AS row_number
   FROM w_time_d;

ALTER TABLE public.business_days
    OWNER TO postgres;

-- FUNCTION: public.getbusdaysdiff(integer, integer)

-- DROP FUNCTION IF EXISTS public.getbusdaysdiff(integer, integer);

CREATE OR REPLACE FUNCTION public.getbusdaysdiff(
	first_date integer,
	actual_date integer)
    RETURNS integer
    LANGUAGE 'plpgsql'
    COST 100
    VOLATILE PARALLEL UNSAFE
AS $BODY$
declare
diff int ;   
begin

select x.row_number-y.row_number into diff
from(
select time_id, row_number from business_days
where time_id = first_date
)x,(select time_id, row_number  from business_days
where time_id = actual_date)y;
   

return diff;
end;
$BODY$;

ALTER FUNCTION public.getbusdaysdiff(integer, integer)
    OWNER TO postgres;

